    "NO", "NO"), nu = 1, dim = c(1468L, 11L), names = c("AOD750", 
    "TISA750", "IT750", "IT2000", "ITCM", "IAREA", "ICURV", "ACW_mm", 
    "ACA", "ACV", "LENSVAULT"), bag.frac = 0.5, na.action = function (x) 
    {
        Terms <- attr(x, "terms")
        if (!is.null(Terms)) 
            yvar <- attr(Terms, "response")
        else yvar <- 0L
        if (yvar == 0L) {
            xmiss <- is.na(x)
            keep <- (xmiss %*% rep(1, ncol(xmiss))) < ncol(xmiss)
        }
        else {
            xmiss <- is.na(x[-yvar])
            ymiss <- is.na(x[[yvar]])
            keep <- if (is.matrix(ymiss)) 
                ((xmiss %*% rep(1, ncol(xmiss))) < ncol(xmiss)) & 
                  ((ymiss %*% rep(1, ncol(ymiss))) == 0)
            else ((xmiss %*% rep(1, ncol(xmiss))) < ncol(xmiss)) & 
                !ymiss
        }
        if (all(keep)) 
            x
        else {
            temp <- seq(keep)[!keep]
            names(temp) <- row.names(x)[!keep]
            class(temp) <- c("na.rpart", "omit")
            structure(x[keep, , drop = FALSE], na.action = temp)
        }
    }), .Names = c("model", "fit", "call", "confusion", "iter", 
"actual", "nu", "dim", "names", "bag.frac", "na.action"), class = "ada")
